import React, { useEffect } from "react";
import { gapi } from "gapi-script";
import "./App.css";

import Header from "./components/Header/Header";
import ItemList from "./components/ProductList/Item";

const clientId =
  "65793818011-ggo7gienivg0jn9j0kfno8t37c7infam.apps.googleusercontent.com";

function App() {
  useEffect(() => {
    function start() {
      gapi.client.init({
        clientId: clientId,
        scope: "",
      });
    }

    gapi.load("client:auth2", start);
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <Header />
        <ItemList />
      </header>
    </div>
  );
}

export default App;
